{"operationName":"getUniswapMarkets","variables":{},"query":"query getUniswapMarkets {
  uniswapmarkets {
    feesUSD
    pool {
      id
      __typename
    }
    symbol
    tvlUSD
    underlying
    volumeUSD
    __typename
  }
}
"}

{"operationName":"getMarketsAndOverview","variables":{"queryOverview":{"chainId":1},"queryMarkets":{"chainId":1},"queryConfig":{"chainId":1}},"query":"query getMarketsAndOverview($queryOverview: OverviewQueryInput, $queryMarkets: MarketviewQueryInput, $queryConfig: ConfigQueryInput) {
  overview(query: $queryOverview) {
    count
    top3Borrows {
      address
      totalBorrowsInETH {
        _hex
        _isBigNumber
        __typename
      }
      __typename
    }
    top3Balances {
      address
      totalBalancesInETH {
        _hex
        _isBigNumber
        __typename
      }
      __typename
    }
    totalBorrowsInETH {
      _hex
      _isBigNumber
      __typename
    }
    totalBalancesInETH {
      _hex
      _isBigNumber
      __typename
    }
    reserveBalanceInETH {
      _hex
      _isBigNumber
      __typename
    }
    totalBorrowers
    totalSuppliers
    __typename
  }
  marketviews(limit: 1000, query: $queryMarkets) {
    underlying
    borrowAPY {
      _hex
      _isBigNumber
      __typename
    }
    chainId
    config {
      borrowFactor
      collateralFactor
      borrowIsolated
      eTokenAddress
      twapWindow
      __typename
    }
    currPrice {
      _hex
      _isBigNumber
      __typename
    }
    dTokenAddr
    dTokenBalance {
      _hex
      _isBigNumber
      __typename
    }
    decimals
    eTokenAddr
    eTokenBalance {
      _hex
      _isBigNumber
      __typename
    }
    eTokenBalanceUnderlying {
      _hex
      _isBigNumber
      __typename
    }
    eulerAllowance {
      _hex
      _isBigNumber
      __typename
    }
    liquidityStatus {
      borrowIsolated
      __typename
    }
    name
    pTokenAddr
    poolSize {
      _hex
      _isBigNumber
      __typename
    }
    pricingForwarded
    pricingType
    reserveBalance {
      _hex
      _isBigNumber
      __typename
    }
    supplyAPY {
      _hex
      _isBigNumber
      __typename
    }
    symbol
    totalBalances {
      _hex
      _isBigNumber
      __typename
    }
    totalBorrows {
      _hex
      _isBigNumber
      __typename
    }
    twap {
      _hex
      _isBigNumber
      __typename
    }
    twapPeriod {
      _hex
      _isBigNumber
      __typename
    }
    underlying
    underlyingBalance {
      _hex
      _isBigNumber
      __typename
    }
    reserveFee
    __typename
  }
  config(query: $queryConfig) {
    cbethAPY
    __typename
  }
}
"}

{"operationName":"usermessages","variables":{"query":{"AND":[{"OR":[{"seenAt_in":[null,null]}]}]}},"query":"query usermessages($query: UsermessageQueryInput) {
  usermessages(query: $query, limit: 100) {
    _id
    address
    message
    seenAt
    __typename
  }
}
"}

{"operationName":"getOracleRating","variables":{},"query":"query getOracleRating($query: OracleratingQueryInput) {
  oracleratings(limit: 10000, query: $query) {
    underlying
    simulations {
      attackBlocks
      pump {
        tradeValuePerBlockUsd
        totalCostUsd
        __typename
      }
      dump {
        tradeValuePerBlockUsd
        totalCostUsd
        __typename
      }
      __typename
    }
    symbol
    __typename
  }
}
"}

{"operationName":"getDelegates","variables":{},"query":"query getDelegates {
  delegates {
    _id
    address
    avatar
    webThreeQualifications
    ens
    interests
    languages
    name
    why
    weight
    __typename
  }
}
"}

